            (*(Fptr + ((row) *Fstride) + ( 1 * 10 + M011))) =  2*b32*a32*a11+2*b22*a12*a21-2*b22*a22*a11-2*b32*a12*a31;
            (*(Fptr + ((row) *Fstride) + ( 1 * 10 + M002))) = -b22*a32*a11+b22*a12*a31+b12*a32*a21+b32*a12*a21-b32*a22*a11-b12*a22*a31;
            (*(Fptr + ((row) *Fstride) + ( 1 * 10 + M100))) =  2*b32*a12*a31-2*b32*a32*a11+2*b22*a12*a21-2*b22*a22*a11;
            (*(Fptr + ((row) *Fstride) + ( 1 * 10 + M010))) =  2*b32*a22*a31-2*b32*a32*a21-2*b12*a12*a21+2*b12*a22*a11;
            (*(Fptr + ((row) *Fstride) + ( 1 * 10 + M001))) =  2*b22*a32*a21-2*b12*a12*a31-2*b22*a22*a31+2*b12*a32*a11;
            (*(Fptr + ((row) *Fstride) + ( 1 * 10 + M000))) = -b32*a22*a11+b22*a32*a11+b32*a12*a21-b22*a12*a31-b12*a32*a21+b12*a22*a31;

            // 1
            (*(Fptr + ((row) *Fstride) + ( 2 * 10 + M200))) =  b22*a12*b31+b22*a32*b11-b12*a32*b21+b12*a22*b31-b32*a22*b11-b32*a12*b21;
            (*(Fptr + ((row) *Fstride) + ( 2 * 10 + M110))) = -2*b12*a12*b31+2*b22*a22*b31-2*b32*a22*b21+2*b32*a12*b11;
            (*(Fptr + ((row) *Fstride) + ( 2 * 10 + M020))) = -b22*a12*b31+b22*a32*b11-b12*a22*b31-b12*a32*b21+b32*a12*b21+b32*a22*b11;
            (*(Fptr + ((row) *Fstride) + ( 2 * 10 + M101))) =  2*b12*a12*b21+2*b22*a32*b31-2*b22*a12*b11-2*b32*a32*b21;
            (*(Fptr + ((row) *Fstride) + ( 2 * 10 + M011))) = -2*b12*a32*b31+2*b12*a22*b21-2*b22*a22*b11+2*b32*a32*b11;
            (*(Fptr + ((row) *Fstride) + ( 2 * 10 + M002))) = -b22*a32*b11-b22*a12*b31+b32*a12*b21+b12*a22*b31+b12*a32*b21-b32*a22*b11;
